import React from "react";

const MainPage=()=>{
    return(
        <div style={{ textAlign: 'center', marginTop: '50px' }}>
            <h1>Welcome to the Main Page</h1>
            <p>This is where you can start designing your application.</p>
        </div>
    )
}

export default MainPage;
